  display: flex;
  justify-content: $justify;
  gap: $gap;
}

@mixin between() {
  display: flex;
  justify-content: space-between;
  @content;
}

@mixin gradient(){
  background: linear-gradient(90deg, #6F48FC 21.63%, #D07EF7 60.55%, #56C6E7 79.11%);
  background-clip: text;
  color: transparent;
}

@mixin blackbutton{
  background-color: #252739;
  color: white;
  border: 4px solid #454545ce;
  padding: 15px 35px;
}

