@use "../abstracts" as *;

.portfolio-card{
    
    background: #f7000040;
}

.portfolio-card > img {
    width: 100%;
    height: 100%;
}

.portfolio-card >div{
    opacity: 0;
    transition: opacity 0.5s ease-in-out;
}

.portfolio-card:hover > div{
    opacity: 1;
    visibility: visible;
    width: 100%;
    height: 100%;
    padding: 2rem;
    color: white;
    display: grid;
    grid-template-columns: 80% 20%;
    gap: 1.5rem;
    grid-row: auto auto;
    align-items: center;
    position: relative;
    top: -50%;
    left: 50%;
    transform: translate(-50%, -50%);
    text-align: left;
    background: #00000040;
}

.portfolio-card > div > h4{
    @include font(2.4rem, $inter-bold);
    line-height: 3rem;
}

.portfolio-card > div > p{
    color: $gray;
    line-height: 1.5rem;
}

.portfolio-card > div > img {
    margin: auto;
    grid-row: 1/3;
    grid-column: 2/3;
}

@include sm{
    .portfolio-card:nth-child(n+6){
        display: none;
    }
}
